*, *::after, *::before {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}

body {
  font-family: "Spartan";
}

p {
  color: #60636D;
}

p {
  font-size: 15px;
}

h1 {
  font-size: 48px;
}

h2 {
  font-size: 40px;
}

@media (min-width: 768px) {
  h1 {
    font-size: 80px;
  }

  h2 {
    font-size: 56px;
  }
}
.location__decoration {
  display: none;
}

@media (min-width: 768px) {
  .location__decoration {
    width: 15px;
    height: 242px;
    position: absolute;
    top: 0;
    left: 49px;
    display: flex;
    justify-content: space-between;
    flex-flow: column;
    align-items: center;
    opacity: 0.3;
  }
  .location__decoration--line {
    width: 1px;
    height: 104px;
    background-color: black;
  }
  .location__decoration--text {
    transform: rotate(90deg) translateX(-20px);
    letter-spacing: 10px;
  }
}
.button-dark {
  background: #1B1D23;
  border: none;
  color: white;
  height: 72px;
  width: 252px;
  font-size: 15px;
}

header {
  margin: 32px;
  display: flex;
  justify-content: space-between;
  align-items: center;
}

button.hamburger {
  padding: 10px;
}

nav {
  display: none;
}

